import React from "react";

function Button({ padding, altname, imgSrc, btnName }) {
  const style = {
    display: "flex",
    gap: "1.2rem",
    alignItems: "center",
    justifyContent: "center",
    padding: padding,
    color: "white",
    fontSize: "1.6rem",
    fontWeight: "600",
    backgroundColor: "#a259ff",
    borderRadius: "20px",
    textDecoration: "none",
    maxWidth: "15rem",
  };

  return (
    <a href="" style={style}>
      <img src={imgSrc} alt={altname} />
      {btnName}
    </a>
  );
}

export default Button;
